demo.repl.help:
అందుబాటులో ఉన్న ఆదేశాలు:
  @show              ─ చివరి అడాప్టివ్ కార్డ్ సారాంశాన్ని చూపించు
  @json              ─ ఫ్లో నుండి వచ్చిన ముడి JSON విలువను వెలువరించు
  @back              ─ మునుపటి బ్లాక్ చేసిన కార్డ్/ఇన్‌పుట్‌లకు తిరుగు
  @input <k>=<v>     ─ ఒక ఇన్‌పుట్ ఫీల్డ్‌ను సెట్ చేయి లేదా ఓవర్‌రైడ్ చేయి
  @click <action_id> ─ ఇచ్చిన చర్యతో కార్డ్‌ను సమర్పించు
  @help              ─ ఈ సహాయ పాఠ్యాన్ని ముద్రించు
  @quit              ─ REPL నుండి నిష్క్రమించు
